import React from 'react';
import SectionHeader from './SectionHeader';
import styled from 'styled-components';
import MapContainer from './MapContainer';

const Styles = styled.div`

background: #d65a31;

.address {
  margin: 0 auto 4vw;
}
`

function Contact() {
  return (
    <Styles id="contact" className="">
      <SectionHeader name="Contact" />
      <div className="border border-danger align-top">
        <div className="d-inline-block p-5 text-sm-center text-lg-left border border-danger">
          <div className="address">
            <h1>Barber Andrew</h1>
            <h1>Orzechowa 50</h1>
            <h1>50-540 Wrocław</h1>
          </div>
          <div class="address">
            <h1>Opening Times:</h1>
            <h1>Monday – Friday: 9.00am – 5.30pm</h1>
            <h1>Saturday: 8.30am – 5.00pm</h1>
            <h1>Sunday: Closed</h1>
          </div>
        </div>
        <MapContainer />
      </div>


    </Styles>
  );



}

export default Contact;
